                        Instantiate(UDL3Center, position: new Vector3(CreateX * 5, 0, CreateZ * 5), rotation: Quaternion.identity);
                        break;
                    case 13:
                        Instantiate(StageGround, position: new Vector3(CreateX * 5, 0, CreateZ * 5), rotation: Quaternion.identity);
                        Instantiate(UpSensor, position: new Vector3(CreateX * 5, 0, CreateZ * 5 + 2), rotation: Quaternion.identity);
                        Instantiate(RightSensor, position: new Vector3(CreateX * 5 + 2, 0, CreateZ * 5), rotation: Quaternion.identity);
                        Instantiate(LeftSensor, position: new Vector3(CreateX * 5 - 2, 0, CreateZ * 5), rotation: Quaternion.identity);
                        Instantiate(ULR3Center, position: new Vector3(CreateX * 5, 0, CreateZ * 5), rotation: Quaternion.identity);
                        break;
                    case 14:
                        Instantiate(StageGround, position: new Vector3(CreateX * 5, 0, CreateZ * 5), rotation: Quaternion.identity);
                        Instantiate(UpSensor, position: new Vector3(CreateX * 5, 0, CreateZ * 5 + 2), rotation: Quaternion.identity);
                        Instantiate(DownSensor, position: new Vector3(CreateX * 5, 0, CreateZ * 5 - 2), rotation: Quaternion.identity);
                        Instantiate(RightSensor, position: new Vector3(CreateX * 5 + 2, 0, CreateZ * 5), rotation: Quaternion.identity);
                        Instantiate(UDR3Center, position: new Vector3(CreateX * 5, 0, CreateZ * 5), rotation: Quaternion.identity);
                        break;
                    case 15:
                        Instantiate(StageGround, position: new Vector3(CreateX * 5, 0, CreateZ * 5), rotation: Quaternion.identity);
                        Instantiate(UpSensor, position: new Vector3(CreateX * 5, 0, CreateZ * 5 + 2), rotation: Quaternion.identity);
                        Instantiate(DownSensor, position: new Vector3(CreateX * 5, 0, CreateZ * 5 - 2), rotation: Quaternion.identity);
                        Instantiate(RightSensor, position: new Vector3(CreateX * 5 + 2, 0, CreateZ * 5), rotation: Quaternion.identity);
                        Instantiate(LeftSensor, position: new Vector3(CreateX * 5 - 2, 0, CreateZ * 5), rotation: Quaternion.identity);
                        Instantiate(UDLR4Center, position: new Vector3(CreateX * 5, 0, CreateZ * 5), rotation: Quaternion.identity);
                        break;
                }
            }
        }
    }
}